import React from "react";
import loginImage from "./resources/images/login.png";
import "./styles/style.css";

function Test() {
  return (
    <div className="container-fluid">
      <div className="row">
        <div
          className="col-7"
          style={{ backgroundImage: `url(${loginImage})`, height: "100vh" }}
        >
          {/* this part is left side of the division */}
        </div>
        <div
          className="col-5 d-flex align-items-center justify-content-center "
          style={{ height: "100vh" }}
        >
          {/* this part is right side of the division. All the login form will stay here */}

          <form action="">
          <h2>Login</h2>

            {/* Email input */}
            <div className="mb-3 ">
              <input
                type="email"
                className="form-control"
                placeholder="Enter email"
              ></input>
            </div>

            {/* password field */}
            <div className="mb-3">
              <input
                type="password"
                className="form-control"
                placeholder="Enter Password"
              />
            </div>

            {/* terms and policies */}
            <p>You are agree to our terms and policies</p>

            {/* login button */}
            <div class="d-grid gap-2">
              <button class="login-button" type="button">
                Login
              </button>
            </div>
          </form>
        </div>
      </div>
    </div>
  );
}

export default Test;
